import React from 'react'
import groupAll from '../images/GroupAll.png'

const Ethos = () => {

    window.onscroll = function () {
        scrollRotate();
    };

    const scrollRotate = () => {
        let image = document.querySelector(".ethos-img");
        image.style.transform = "rotate(" + window.pageYOffset/6 + "deg)";
    }

    return (
        <>
            <div className="content-ethos">
                <div className="title-the">
                    <h2 className="content-ethos__title-the">THE</h2>
                </div>
                <div className="title-ethos">
                    <h2 className="content-ethos__title-ethos">ETHOS</h2>
                </div>
                <img className="ethos-img" src={groupAll} alt=""/>
            </div>
        </>
    )
}

export default Ethos
